    return (
        <div className="App">
            <div className="LTbackground">
                <p>{UserInput()}</p>
            </div>
        </div>
    );
}

function UserInput() {
    return (
        <div>
            <h2 class="test">Hello</h2>
            <form>
                <label>How many people are you?</label>
            </form>
        </div>
    );
}

export default App;
